@Override
protected void setUp() throws Exception {
  super.setUp();
  normMap = new NormalizeCharMap();

  normMap.add( "aa", "a" );
  normMap.add( "bbb", "b" );
  normMap.add( "cccc", "cc" );

  normMap.add( "h", "i" );
  normMap.add( "j", "jj" );
  normMap.add( "k", "kkk" );
  normMap.add( "ll", "llll" );

  normMap.add( "empty", "" );
}

